create table monsters_spawns
(
    Id         int auto_increment
        primary key,
    MapId      int                       null,
    SubAreaId  int                       null,
    MonsterId  int                       not null,
    Frequency  float(16, 2) default 1.00 not null,
    MinGrade   int          default 1    not null,
    MaxGrade   int          default 5    not null,
    IsDisabled tinyint                   not null
)
    engine = MyISAM
    charset = utf8;

